  input: '"TEXT","F3A","C00364349","This amendment is in response to your letter stating
    a concern with the Year-End Report filed by the Weller for Congress Committee.  In
    your letter dated April 2, 2002, your report indicates the use of calendar year-to-date
    figures when aggregating and reporting receipts and disbursements.  Please note
    that this amendment now shows election cycle-to-date figures for all aggregate
    amounts. Taking in to account that this committee was formed on January 31, 2001.  You
    also indicated that the campaign must attempt to obtain the occupations and name
    of employer for all individuals who contribute more than $200 in a calendar year.   Our
    procedure regarding this matter is sending a letter to the contributor clearly
    requesting the following information.  If the information is not provided we then
    again send out another written requested clearly requesting the information.  If
    you need a copy of this letter we will be glad to forward it to you.  Please also
    note that Schedule A now itemizes spouses individually.  Please be advised that
    there is one contributor over their contribution limit.  A Reattribution/Redesignation
    request has been mailed to him.  If you need a copy of this letter we will be
    glad to forward it to you as well.  The committee has taken the necessary steps
    so this will not happen in the future.  If you have any further questions please
    let us know."'
